import { render } from '@testing-library/react';
import React from 'react';
import classes from './OneRole.css'
import newImg from './newimg.jpg'
const oneRole=(props) =>{
    let name=  props.name;
    let permission=  props.permission;
    let roleId = props.roleId;

    let permdiv = permission.map(event =>(
        <div>
            <h3>{event}</h3><br/>
        </div>
    ))

    return (

        <div className="col-md-6 col-lg-4 col-xl-3">
        <figure className="snip1527">
          <div className="image"><img src={newImg} /></div>
          <figcaption>
          <h3>NAME: {name}</h3>
          <div>
            {permdiv}
        </div>
            <h3>Role ID :{roleId}</h3>
          </figcaption>
          <a ></a>
        </figure>
      </div>
    )}

export default oneRole;
